import React, { useState } from "react";
import "./content.scss";
import { StyleSheet, Dimensions, View } from 'react-native';
import Pdf from 'react-native-pdf';


function Curriculum() {
  let yourPDFURI = { uri: "./DMLinsAraujoCV.pdf", cache: true };
  return (
    <div>
      <h1>CV</h1>
      <ul>
        <View style={{ flex: 1 }}>
          <Pdf
            ref={(pdf) => {
              this.pdf = pdf;
            }}
            source={yourPDFURI}
            style={{ flex: 1 }}
            onError={(error) => {
              console.log(error);
            }}
          />
        </View>
        <a href="https://bit.ly/3coQnrG" target="_blank">
          CV
        </a>
      </ul>
    </div>
  );
}

export default Curriculum;
